import React from "react";
import { Link } from "react-router-dom";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, EffectFade } from "swiper";
import "swiper/css";
import "swiper/css/effect-fade";

const Home = () => {
  const roomTypes = [
    {
      id: 1,
      name: "Deluxe Room",
      image: "https://via.placeholder.com/600x400", // Thay bằng ảnh thật
      description: "Luxurious rooms with amazing views.",
    },
    {
      id: 2,
      name: "Standard Room",
      image: "https://via.placeholder.com/600x400",
      description: "Affordable yet comfortable.",
    },
    {
      id: 3,
      name: "Suite",
      image: "https://via.placeholder.com/600x400",
      description: "Spacious rooms for family vacations.",
    },
  ];

  return (
    <div className="bg-gray-100">
      {/* Banner */}
      <div className="relative h-[60vh] md:h-[80vh] bg-cover bg-center" style={{ backgroundImage: "url('https://via.placeholder.com/1920x1080')" }}>
        <div className="absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center">
          <div className="text-center text-white">
            <h1 className="text-4xl md:text-6xl font-bold">Welcome to Our Hotel</h1>
            <p className="mt-4 text-lg md:text-xl">Experience luxury and comfort like never before.</p>
            <Link to="/rooms" className="mt-6 inline-block bg-yellow-500 text-white px-6 py-3 rounded-md shadow-md hover:bg-yellow-600 transition">
              Explore Rooms
            </Link>
          </div>
        </div>
      </div>

      {/* Room Types Carousel */}
      <div className="py-12">
        <h2 className="text-3xl md:text-4xl font-bold text-center text-gray-800 mb-8">Our Rooms</h2>
        <Swiper
          modules={[Autoplay, EffectFade]}
          spaceBetween={50}
          slidesPerView={1}
          autoplay={{ delay: 3000 }}
          effect="fade"
          className="w-full max-w-5xl mx-auto"
        >
          {roomTypes.map((room) => (
            <SwiperSlide key={room.id}>
              <div className="relative group">
                <img src={room.image} alt={room.name} className="w-full h-[300px] md:h-[500px] object-cover rounded-lg shadow-lg" />
                <div className="absolute inset-0 bg-black bg-opacity-40 opacity-0 group-hover:opacity-100 transition flex flex-col items-center justify-center text-white p-6 rounded-lg">
                  <h3 className="text-2xl font-bold">{room.name}</h3>
                  <p className="mt-2">{room.description}</p>
                  <Link to={`/room/${room.id}`} className="mt-4 bg-yellow-500 px-4 py-2 rounded-md shadow hover:bg-yellow-600">
                    View Details
                  </Link>
                </div>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>

      {/* Services Section */}
      <div className="bg-white py-12">
        <h2 className="text-3xl md:text-4xl font-bold text-center text-gray-800 mb-8">Why Choose Us?</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-6xl mx-auto">
          <div className="flex flex-col items-center text-center">
            <img src="https://via.placeholder.com/100" alt="Free Wi-Fi" className="w-16 h-16 mb-4" />
            <h3 className="text-xl font-semibold">Free Wi-Fi</h3>
            <p className="text-gray-600 mt-2">Stay connected with high-speed internet access.</p>
          </div>
          <div className="flex flex-col items-center text-center">
            <img src="https://via.placeholder.com/100" alt="Swimming Pool" className="w-16 h-16 mb-4" />
            <h3 className="text-xl font-semibold">Swimming Pool</h3>
            <p className="text-gray-600 mt-2">Relax and enjoy our luxurious pool facilities.</p>
          </div>
          <div className="flex flex-col items-center text-center">
            <img src="https://via.placeholder.com/100" alt="Luxury Rooms" className="w-16 h-16 mb-4" />
            <h3 className="text-xl font-semibold">Luxury Rooms</h3>
            <p className="text-gray-600 mt-2">Experience world-class luxury and comfort.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
